snippet.description:
Acompanhe AO VIVO e interaja com a Cerimônia do nosso casamento.

Prepare o coração, o vestido de festa (ou terno) e a pipoca. Você acompanhou até aqui e não podia ficar de fora deste dia.

Estamos muito ansiosos pelo que Deus vai fazer. Beijos e até lá!

Quer Presentear os Noivos? Acesse: www.lumigor.com.br

Ficha Técnica:

Dirigido por Gabriel Reis ( @gabrielxreis_ )

Produção Executiva: Tiago Lopes ( @__lopestiago )

Câmera 1: Gustavo Ferreira ( @gustavoxferreira )
Câmera 2: Ighor Lengruber ( @doighor )
Câmera 3: Felipe Martins ( @edicaoagil )
Câmera 4: Guilherme
Assistente 1: Arthur Ribeiro ( @arthurgribeira )
Assistente de Transmissão: Marcos Góes (@goesm_jr)
Drone: Victor Yagyu ( @victoryagyu )

